import React from "react";
import styles from "./PopupCropperPreview.module.css";
import cn from 'classnames';
const PopupCropperPreview = ({ url = '', className, classImage }) => {
  return (
    <>
     {(url) ? 
        <div className={cn(styles.preview, className)} >
            <img className={cn(styles.image, classImage)} src={url} alt="preview" />
            <div className="menu">

            </div>
        </div>
        : null}
    </>
  );
};
export default PopupCropperPreview;
